function hora_actual() {
	
	var d = new Date();
	var dia = d.getDate();
	var mes = d.getMonth()+ 1;
	var ano = d.getFullYear();
	var hora = d.getHours();
	var min = d.getMinutes();
	

	if(dia < 10)
	{
		dia = "0"+ dia;
	}
	if(mes < 10)
	{
		mes = "0"+ mes;
	}
	
	if(min < 10)
	{
		min = "0"+ min;
	}
	
	if(hora < 10)
	{
		hora = "0"+ hora;
	}
	
	$("#fecha_actual_ajax").text(dia+"-"+mes+"-"+ano.toString().substring(2, 4)+" " +hora+":"+min);
}

